// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract MineProxy {
    using ECDSA for bytes32;

    Ownable public mine;

    constructor(address _mine) {
        mine = Ownable(_mine);
    }

    function claim(bytes calldata callData, bytes memory signCallData) public {
        require(
            keccak256(callData).recover(signCallData) == mine.owner(),
            "EXCUTE_CALL_FAILED"
        );
        (bool success, ) = address(mine).call(callData);
        require(success, "EXTERNAL_SWAP_EXECUTION_FAILED");
    }
}
